try {
  document.addEventListener('keyup', listen);
  let keystroke = '';

  function listen(e) {
    keystroke += e.which;
    const matches = [
      { keys: /\d*677265827390658268$/, animation: charizard },
      { keys: /\d*80737565677285$/, animation: pikachu },
      { keys: /\d*66768569836782696978$/, animation: blueScreen }
    ];

    matches.forEach((match) => {
      if (match.keys.test(keystroke)) {
        match.animation.call();
        keystroke = '';
      }
    });

    if (keystroke.length > 250) {
      let l = [...keystroke].splice(0, keystroke.length - 14);
      keystroke = l.join('');
    }
  }

  function charizard() {
    // tslint:disable-next-line: max-line-length
    const flamethrower64 = '';
    const charizard64 = '';
    const flamethrowerSound = new Audio('data:audio/mp3;base64,' + flamethrower64);
    const charizardSound = new Audio('data:audio/mp3;base64,' + charizard64);

    const imgSrc1 = 'https://mimiccdn.stukent.com/images/fun/charizard.png';
    const imgSrc2 = 'https://mimiccdn.stukent.com/images/fun/charizard.gif';

    const fire = document.createElement('div');
    const img = new Image();
    const imgHeight = '490px';
    img.src = imgSrc1;
    img.style.transition = '1s all';
    img.style.position = 'fixed';
    img.style.left = 'calc(50% - 229px)';
    img.style.bottom = `-${imgHeight}`;
    img.style.zIndex = 999999;

    charizardSound.onended = () => {
      img.src = imgSrc2;
      flamethrowerSound.play();
      // show fire
      fire.style.width = '100%';
      fire.style.height = '100%';
      fire.style.left = 0;
      fire.style.top = 0;
      fire.style.position = 'fixed';
      fire.style.zIndex = 9999999;
      fire.style.background = 'orange';
      fire.style.opacity = 0;

      document.body.appendChild(fire);
      for (let x = 0; x < 81; x++) {
        (x => {
          window.setTimeout(() => {
            if (x % 2 === 0) {
              fire.style.opacity = 0;
            } else {
              fire.style.opacity = 0.3;
            }
          }, x * 25);
        })(x);
      }
    }

    flamethrowerSound.onended = () => {
      img.src = imgSrc1;
      fire.remove();
      img.style.bottom = `-${imgHeight}`;
      window.setTimeout(() => {
        img.remove();
      }, 500)
    }

    charizardSound.play();
    document.body.appendChild(img);

    window.setTimeout(() => {
      img.style.bottom = '0px';
    }, 50);
  }

  function pikachu() {
    // tslint:disable-next-line: max-line-length
    const audioInit = '';
    const sound = new Audio('data:audio/mp3;base64,' + audioInit);
    sound.play();

    const data = 'https://mimiccdn.stukent.com/images/fun/pikachu.gif';

    const shock = document.createElement('div');
    const img = new Image();
    img.src = data;
    img.style.width = '250px';
    img.style.height = '149px';
    img.style.transition = '1s all';
    img.style.position = 'fixed';
    img.style.left = 'calc(50% - 125px)';
    img.style.bottom = '-149px';
    img.style.zIndex = 999999;

    document.body.appendChild(img);
    window.setTimeout(() => {
      img.style.bottom = '0px';
    }, 50);

    window.setTimeout(() => {
      shock.style.width = '100%';
      shock.style.height = '100%';
      shock.style.left = 0;
      shock.style.top = 0;
      shock.style.position = 'fixed';
      shock.style.zIndex = 9999999;
      shock.style.background = '#fffb95';
      shock.style.opacity = 0;

      document.body.appendChild(shock);
      for (let x = 0; x < 81; x++) {
        (x => {
          window.setTimeout(() => {
            if (x % 2 === 0) {
              shock.style.opacity = 0;
            } else {
              shock.style.opacity = 0.3;
            }
          }, x * 25);
        })(x);
      }
    }, 2500);

    window.setTimeout(() => {
      img.style.bottom = '-149px';
    }, 4300);
    window.setTimeout(() => {
      img.remove();
      shock.remove();
    }, 5400);
  }

  function blueScreen() {
    const beep64 = '';

    const beepSound = new Audio('data:audio/mp3;base64,' + beep64);
    const imgSrc = 'https://mimiccdn.stukent.com/images/fun/bluescreen.jpg';
    
    const img = new Image();
    img.src = imgSrc;
    img.style.width = '100vw';
    img.style.height = '100vh';
    img.style.position = 'fixed';
    img.style.left = '0';
    img.style.top = '0';
    img.style.zIndex = 999999;

    document.body.appendChild(img);
    beepSound.play();

    window.setTimeout(() => { img.remove() }, 5000)
  }
  
} catch (e) { }